INSERT INTO `dogadjaj` VALUES (26,'Kostana','Slavija, 1','2023-06-27 15:20:00.000000','slike/dogadjaji/Kostana-5_EmxqwcX.jpg','planiran','Koštani se nudi povlašćen i situiran život u najbogatijoj kući u gradu,ali u suštini -zlatni kavez.Između Hadži Tomine kuće-zlatnog kaveza …i čerge, koštana bira čergu ,jer time bira ….Slobodu.I na kraju, nisam nikada poverovao da je Koštana melodrama sa depresivnim krajem.','Po uzoru na roman, Kostana je prepuna uzbudljivih radnji i zapleta.',1,1),(27,'BRAK – MRAK','Makenzijeva, 20','2023-05-25 21:00:00.000000','slike/dogadjaji/brak-mrak_VMj7YmM.jpg','planiran','Duo komedija „Brak- mrak“ se dopadljivo i dovitljivo igra sa duhovitim i preciznim raspoznavanjem tipova supruznika, te daje svakom gledaocu i gledateljki oduska u smehotresnim receptima kako se resiti bracnih muka. Glumci Aleksandra Beloševiž i Janko Cekić nas u ulogama bracnih terapeuta vesto vode kroz razne razmirice pomazuci da se nasmejemo.','Posle koliko godina se ono čuveno „i u dobru i u zlu, do kraja života „pretvara u svakodnevnu borbu',1,1),(28,'SUMNJIVO LICE','Turgenjeva, 5','2023-06-02 19:00:00.000000','slike/dogadjaji/sumnjivo-lice.jpg','planiran','Predstava je rađena po jednom od najpoznatijih dela Branislava Nušića, koje je neizostavni deo lektire za osnovne škole. Na duhovit, zanimljiv i lepršav način, uz kreativno osmišljene filmske sekvence, raskošnu scenografiju i kvalitetnu muziku, glumci će oživeti živopisne likove kojima je Nušić opisao stanje u društvu, ali i ismejao loše karakterne osobine ljudi, koje su univerzalne i prisutne u svakom vremenu. Predstava je namenjena kako učenicima osnovnih i srednjih škola, tako i starijim građanima.','Po uzoru na jedno od najpoznatijih dela, spremite se za uzbudjenje i smeh.',1,33),(29,'Koncert Cece Ražnatović','Niška tvrđava \' plato','2023-05-23 21:00:00.000000','slike/dogadjaji/ceca-kocert.jpg','planiran','Koncert Cece Raznatovic u Niskoj tvrdjavi je dugo iscekivan. 2 sata kvalitetnog programa je pred nama, dogadjaj za ne propustiti za sve fanove zabavne muzike.','Ceca Raznatovic se vraca u Nis zajedno sa svojim bendom. Ovo je prilika koja se ne sme propustiti.',1,1),(30,'Finale ABA lige','Hala Aleksandar Nikolić','2023-06-11 19:00:00.000000','slike/dogadjaji/derbi.jpg','planiran','KK Crvena Zvezda i Partizan će odmeriti snage u trećoj utakmici finala ABA lige u kojoj je trenutno rezultat 1-1. Da li će Zvezda iskoristiti prednost domaćeg terena ili Partizan odnosi pobedu, saznajte 11. juna u Pioniru uz nezaboravnu atmosferu.','Finalna serija ABA i ujedno derbi lige je svakako vrhunac celogodišnjeg takmičenja.',1,33),(31,'10. kolo Roda super lige','Humska 1','2023-05-28 15:33:00.000000','slike/dogadjaji/partizan-u-17.jpg','planiran','Partizan već duži niz godina ulaže u svoje mlađe selekcije, a sada je došao trenutak kada im je potrebna najveća podrška.','Podržite orliće u utakmici u kojoj selekcija U17 Partizana dočekuje OFK Beograd.',1,1),(32,'Revijalna utakmica Srbija - Slovenija','Štark arena','2023-05-28 21:00:00.000000','slike/dogadjaji/srbija-kosarka.jpg','planiran','Revijalna utakmica Srbija - Slovenija u okviru priprema za svetsko prvenstvo.','Revijalna utakmica Srbija - Slovenija u okviru priprema za svetsko prvenstvo.',1,1),(33,'NMSJ žurka','Dunavska 86','2023-06-25 22:00:00.000000','slike/dogadjaji/nmsj.jpg','planiran','Neguj mo Srpski Jezik letnja žurka u Hangaru.','Neguj mo Srpski Jezik letnja žurka u Hangaru.',1,33),(34,'tmrw Conference','Štark arena','2023-06-19 08:30:30.000000','slike/dogadjaji/tmrw-conf.jpg','planiran','tmrw je aktuelna svetska konferencija na temu Metavers-a i BlockChain-a. Pridruzite se ekspertima i informišite se o aktuelnim temama u svetu.','tmrw je aktuelna svetska konferencija na temu Metavers-a i BlockChain-a.',1,1),(35,'Koncert Piknik Park','Zappa baza','2023-06-12 12:00:20.000000','slike/dogadjaji/Linkin-Park.jpg','planiran','Osnovani u Budimpesti 2017. godine, Piknik park se probio kao jedan od najboljih tribute bendova Linkin Parka. Od starih hitova poput Papercut i Crawling, pa sve do poslednje pesme One More Light, uzivacete u nezaboravnoj atmosferi.','Koncert koji fanovi LinkIn Parka ne smeju da propuste.',1,33),(36,'A','a','2023-05-31 12:59:20.000000','slike/dogadjaji/Linkin-Park_IW85IfF.jpg','planiran','a','A',1,1),(39,'Brak - Mrak','Svetog Save 16-18','2023-07-04 20:00:00.000000','slike/dogadjaji/brakmrak.jpg','planiran','U komediji \'Brak-mrak\', duo Aleksandra Beloševiž i Janko Cekić majstorski dočaravaju svakodnevne borbe i razmirice u braku. Kroz duhovite situacije i precizno raspoznavanje tipova supružnika, ova pitka komedija pruža osvežavajući oslobađajući smeh, dok nas brčni terapeuti vode kroz faze prilagođavanja i pomognu nam da sa humorom prevaziđemo izazove zajedničkog života. Iz ove predstave svako će pronaći delove sebe i svog partnera, dok prstohvat humora začini i oživi \'mračne delove\' braka.','Smehotresna komedija o izazovima braka i duhovitom prevazilaženju svakodnevnih borbi sa partnerom.',1,44),(40,'CABARES CABAREI','Svetog Save 16-18','2023-07-07 20:00:00.000000','slike/dogadjaji/cabares_MHVTCkj.jpg','planiran','U kabareu \'CABAres, CABArei\', Zijah A. Sokolović nemilosrdno razgolićava život i suštinsku dezorijentaciju modernog čoveka. Kroz crni humor i agresivno karikiranje čulnosti, ova predstava postaje filozofski komentar na besmisao života, spajajući besmislice sveta i intimne pojedinosti. Sokolović nas vodi kroz lavirinte životnih muka, od ratova i mržnje do bračnih odnosa i ljubavi, istovremeno bivajući komentator i žrtva tih neminovnosti. Kabaret nas vodi od neukrotivog smeha do ledene užasnutosti, igrajući se emocijama i mišljenjem publike.','Crni humor o suštini života i nemilosrdnom razgolićavanju svakodnevnice.',1,44),(41,'SOKIN I BOSINA','Svetog Save 16-18','2023-07-05 20:00:00.000000','slike/dogadjaji/sokin.jpg','planiran','U komediji \'Sokin sin i Bosina ćerka\', sjajan glumački tandem, reditelj i energija predstave donose osvežavajući pogled na likove kao što su Tašte, Svekrve, snaje i zetovi. Ova urnebesna komedija otkriva kako se kroz zavere u korist sopstvene dece može izroditi neočekivana situacija. Iako su ovi likovi već poznati i viđeni u komedijama, njihova nova interpretacija donosi osećaj svežine, a publika s nestrpljenjem iščekuje razrešenje njihovih komplikacija. Smeh, intrige i iznenađujuće uloge čine ovu predstavu neodoljivom.','Urnebesna komedija o zaveri, snajkama, zetovima i iznenađujućim ulogama.',1,44),(42,'Ulovi muža','Svetog Save 16-18','2023-07-06 20:00:00.000000','slike/dogadjaji/ulovi.jpg','planiran','Predstava \'Ulovi muža\' je smeštena u Rusiju početkom prošlog veka i donosi grotesknu komediju o dva uigrana prevaranta koji pokušavaju da prevare majku i ćerku, predstavljajući se lažno kao imućni knez i njegov sestrić. Istovremeno, majka želi da uda svoju smušenu ćerku. Kroz nesporazume, potkupljivanje i pokušaje da se izvuku iz neprilike, komični zaplet se razvija sve dok smušena ćerka ne raskrinka prevaru. Ova predstava otkriva dinamične situacije koje proističu iz prevara i komičnih nesporazuma, pružajući publici nezaboravno iskustvo smeha i raskrinkavanja.','Groteskna komedija o prevarantima, nesporazumima i raskrinkavanju u Rusiji prošlog veka.',1,44),(43,'UPOZNAJ MOG TATU','Karađorđeva 7','2023-07-05 20:00:00.000000','slike/dogadjaji/mog_tatu_MPbWGye.jpg','planiran','U predstavi \'Upoznaj mog tatu\', mladi i perspektivni Greg odlučuje da upozna roditelje svoje izabranice Džini kako bi razjasnio sve nedoumice u njihovoj napetoj vezi. Međutim, ono što ga tamo čeka je potpuna nepredvidljivost. Kroz mehanizam opsesivnog laganja, junaci ove komedije zabune izbegavaju suočavanje sa istinom i pronalaze najbizarnije načine da je izbegnu. Njihove lične verzije stvarnosti sukobljavaju se, otkrivajući najtamnije strane ljudske prirode na neobičan i veoma zabavan način.','Napeta i dinamična komedija zabune o opsesivnom laganju i suočavanju sa istinom.',4,45),(46,'KIRIJA','Karađorđeva','2023-07-06 20:00:00.000000','slike/dogadjaji/kirija_v5lrI1C.jpg','planiran','Autor se upita kako bi izgledala Nušićeva igra danas i šta bi se dogodilo sa porodicom koja se suočava sa finansijskim problemima. Pitanja se postavljaju o postojanju ljudi koji, uprkos poštenom radu, ne mogu obezbediti osnovne potrebe za život. Kako očuvati porodicu u takvim okolnostima? Ovaj rukopis je nastao razmišljanjem o Nušićevoj komediji, zadržavajući suštinske elemente, ali možda otkrivajući nešto više od same šale. Jer Nušić je uvek Nušić!','Predstava \"Kirija\" se naziva i \"Šala u jednom činu\", ali da li je to zaista šala?',4,45),(47,'KARAMAZOVI','Branka Radicevica 1','2023-07-05 20:00:00.000000','slike/dogadjaji/Karamazovi.jpg','planiran','To je strast koja može buknuti plamenom i razarati sve pred sobom, zahvatajući Fjodora, Dmitrija, Ivana, Aljošu, Grušenjku i Katarinu. Predstava \"Sablasni eros\" Vladimira Lazića interpretira tu rusku ljubav iz romana \"Braća Karamazovi\" na različite načine, prikazujući nesputane i neobuzdane strane Karamazova, Grušenjke i Katarine, kako u njihovim međusobnim zagrljajima, tako i izvan njih. Ova ljubav teži identifikaciji sa samom sobom, ali kada ta čežnja propadne, zlo se rađa kao kompenzacija, moć koja uništava. Smrt i patnja postaju neponovljiva manifestacija svake oduzete ljubavi.','Fjodor Mihajlovič Dostojevski nas upozorava da prepoznamo zlo u čoveku, čak i u njegovim začecima.',5,46),(48,'Bračni prevrtljivci','Branka Radicevica 1','2023-07-06 20:00:00.000000','slike/dogadjaji/bracni_rSs1eAn.jpg','planiran','Ova predstava je priča o sudbinama i prijateljstvu koje se obnavlja nakon godišnjice mature. Emilija, nekada najlepša gimnazijalka, ima prividno savršen brak. Vanja je osoba kojoj se svako može poveriti, a Boris je glumac koji se bori s godinama i želi ostati relevantan. Nakon proslave, njih troje se okuplja u Vanjinoj mansardi gde se otvaraju i otkrivaju svoje probleme. Kroz niz susreta, njihovi životi se sve više komplikuju - bračni problemi, karijere, ljubavni trouglovi.','Predstava o sudbinama prijatelja iz gimnazijskih dana, suočenim s problemima u životu.',5,46),(49,'Vlast','Branka Radicevica 1','2023-07-09 20:00:00.000000','slike/dogadjaji/vlastiii1.jpg','planiran','\"Vlast\" je nezavršena komedija Miodraga Petrovića Nušića, ali uprkos tome ostala je jedan od njegovih najpopularnijih komada. Adaptacije ove komedije su napravljene od strane različitih pisaca i reditelja, a najpoznatija je verzija Miroslava Belovića. U svojoj adaptaciji za pozorište \"Toša Jovanović\", autor ovih redova je sačuvao duh Nušića i prilagodio tekst specifičnostima tog pozorišta. Predstava se bavi temama karijerizma, korupcije, ambicija i vlasti, koje su i danas veoma aktuelne.','Nušićeva nezavršena komedija o ambiciji i korupciji.',5,46),(50,'KKCZ - Panatinaikos','Hala Aleksandar Nikolić','2023-10-22 19:00:00.000000','slike/dogadjaji/zvezda-panata.jpg','planiran','Crvena zvezda ove godine počinje jesenju avanturu u Evroligi utakmicom protiv Panatinaikosa. Pred prepunim tribinama Pionira, delije su veliki favoriti za pobedu. Ekipa Duška Ivanovića je u veoma dobroj formi i očekuje se pobeda pred domaćim navijačima.','1. kolo Evrolige koje svaki delija ne sme propustiti. Pružite podršku ekipi u Pioniru.',1,39),(51,'Hokej: Srbija - Slovenija','Ledena hala Pionir','2023-12-05 21:15:41.000000','slike/dogadjaji/hokej.jpg','planiran','Rivalstvo dve najveće hokejaške reprezentacije bivše Jugoslavije nikad nije bilo veće. Podržite srpske hokejaše koji u sklopu priprema za svetsko prventstvo igraju revijalnu utakmicu protiv Slovenije.','Revijalna utakmica između Srbije i Slovenije je događaj koji fanovi hokeja ne smeju propustiti.',1,39),(52,'Hokej: Srbija - Slovenija','Ledena hala Pionir','2023-12-05 21:15:41.000000','slike/dogadjaji/hokej_e7IuCFR.jpg','planiran','Rivalstvo dve najveće hokejaške reprezentacije bivše Jugoslavije nikad nije bilo veće. Podržite srpske hokejaše koji u sklopu priprema za svetsko prventstvo igraju revijalnu utakmicu protiv Slovenije.','Revijalna utakmica između Srbije i Slovenije je događaj koji fanovi hokeja ne smeju propustiti.',1,39),(53,'KK Partizan - Cedevita','Beogradska Arena','2023-06-30 21:15:41.000000','slike/dogadjaji/cedevita-partizan.jpeg','planiran','Cedevita i Partiza su dugogodišnji rivali. Iako sa mnogo jačim sastavom, Partizam se ove godine dosta namučio u plej ofu ABA lige gde su u svim serijama igrali odlučujuću utakmicu. Da li Cedevita može da iznenadi Partizan i osigura svoje prvo finale posle 7 godina?','Trećai odlučujuća utakmica polufinala ABA lige. Da li Cedevita pravi iznenađenje godine?',1,40),(54,'Čukarički U21 - Levski U21','Čair','2023-07-20 21:15:41.000000','slike/dogadjaji/cukaricki.jpg','planiran','Podržite mladu i obećavajuću selekciju Čukaričkog protiv bugarskog rivala.','Čukarički i Levski odmeravaju snage u kvalifikacijama za Juniorsku ligu evrope.',3,40),(55,'KK Konstantin - KK Pirot','Hala Dušan Radović','2023-07-28 21:15:41.000000','slike/dogadjaji/kk-pirot.jpeg','planiran','Prva liga će dobiti predstavnika iz južne Srbije. Da li će to biti KK Konstantin koji se posle dužeg vremena vraća na pobedničke staze ili će to postići najprijatnije iznenađenje KK Pirot?','Finale plej ofa koje će pobednika poslati u Prvu srpsku košarkašku ligu.',3,40),(56,'KK Radnički - KK Mega','Ranko Žeravica hala','2023-07-05 21:15:41.000000','slike/dogadjaji/mega.jpg','planiran','Plej of KLS-a počinje najzanimljivijom utakmicom. Dve ekipe koje su po kvalitetu veoma blizu igraju u prvom kolu i bore se za prolaz u polufinale.','Plej of KLS-a počinje utakmicom dva dobro poznata rivala. Omladinci Mege ili veterani Radničkog?',5,40),(57,'FK Mladost - FK Vojvodina','Stadion Mladost','2023-08-05 21:15:41.000000','slike/dogadjaji/vojvodina.jpeg','planiran','Mladost ili Radnički - koja ekipa startuje pobedom. S obzirom na finansijske probleme, Mladost ulazi kao favorit međutim nikada ne treba otpisivati ekipu Lalatovića.','Prvo kolo Ling Long super lige počinje duelom Mladosti i Radničkog.',7,41),(58,'OK Nibak - OK Pirot','Hala Dušan Radović','2023-07-28 21:00:41.000000','slike/dogadjaji/ok_pirot.jpg','planiran','Pirot i Nibak su u pred ispadanjem nakon pružanja veoma slabih partija tokom sezone. Koji tim će ostati u ligi?','Poslednje kolo druge odbojkaške lige, koja ekipa obezbeđuje opstanak?',3,41),(59,'Koncert Piknik Park','Zappa baza','2023-07-11 22:07:49.000000','slike/dogadjaji/linkinv2.jpg','planiran','Od Papercut do One More Light, repertoar tribute benda je zaišta pozamašan. Nakon veoma uspešne turneje u SAD, konačno dolaze u Srbiju, koncert koji fanovi ne smeju propustiti.','Jedan od najpopularnijih Linkin Park tribute bendova konačno dolazi u Srbiju.',1,41),(60,'Koncert Željka Bebeka','Hala Čair','2023-07-17 20:00:49.000000','slike/dogadjaji/bebek.jpg','planiran','Željko Bebek, iz ranijih dana poznat kao pevač grupe Bijelo dugme, napravio je izvanrednu solo karijeru.','Nakon duge pauze Željko Bebek se vraća u Niš i halu Čair.',3,41),(61,'Koncert Jelene Rozge','Velika Hala Smederevo','2023-07-10 21:00:49.000000','slike/dogadjaji/rozga.jpg','planiran','Jelena Rozga, bivši vokal grupe Magazin, veoma uspešna u solo karijeri, dolazi konačno u Smederevo.','Koncert jedne od diva balkanske scene, uživajte u dinamičnoj atmosferi.',4,41),(62,'Fantom u operi','Gradska kuća, Subotica','2023-07-10 21:00:49.000000','slike/dogadjaji/opera.jpg','planiran','Subotička opera, nastala u prošlom veku, doživela najveći procvat devedesetih godina, danas se odlikuje inovacijom i širokom publikom. Fantom u operi svakako spada u jednu od njihovih najboljih dela.','Subotička opera izvodi jednu od svojih najuspešnijih i najposećenijih tačaka.',6,41),(63,'Exit festival prvi dan','Petrovaradin','2023-07-10 22:07:49.000000','slike/dogadjaji/exit.jpg','planiran','Exit je sinonim za dobru žurku i kvalitetnu muziku. Uživajući tradiciju više od 20 godina, svake godine okuplja široku publiku iz Evrope. Uživajte u hitovima Wu-Tang-a i Davida Guette.','Exit je najveći festival tehno muzike na balkanu. Wu-tang, David Guetta i Migos nastupaju ove godine',2,41),(64,'Buč Kesidi na Tašmajdanu','Tašmajdan','2023-06-19 22:00:49.000000','slike/dogadjaji/buc_kesidi.jpg','planiran','Buč Kesidi nastao pre nekoliko godina je bend koji je odmah privukao dosta pažnje u krugu studenata. Odlikuju se lucidnim tekstovima, energičnim rifovima i veoma dobrim nastupima.','Kao jedan od najvećih dolazećih rok bendova, Buč Kesidi dolazi u Beograd u okviru srpske turneje.',1,41),(65,'2000late letnja žurka','Hangar','2023-07-10 22:07:49.000000','slike/dogadjaji/2000late.jpg','planiran','2000late je žurka koju svi ljubitelji muzike sa početka ovog veka ne smeju da propuste. Uživajte u muzici na 3 stejdža uz promocije pića.','Uživajte u hitovima sa početka ovog veka. Elitni odredi, Gazda Paja, Eminem, LMFAO....',1,41),(66,'Lasta Elektrijada After','Lasta splav','2023-07-31 22:07:49.000000','slike/dogadjaji/splav_lasta_ambijent.jpg','planiran','Uživajte u zvaničnom afteru Elektrijade uz DJ Kalu-a. Za studente je posebno obezbeđena promo cena pića.','Nakon elektrijade, zvaničan after na Lasti.',1,42),(67,'Beergarden svirka','Beer Garden','2023-07-24 22:07:49.000000','slike/dogadjaji/beer-garden.jpg','planiran','Subota veče je uvek rezervisana za svirke u Beer Gardenu. Ovog puta na programu je Dis Duo Acoustic koji će svirati Ex-Yu muziku.','Uživajte u suboti uz Dis Duo Acoustic i hladno pivo.',3,42),(68,'Troy subota','Klub Troy','2023-07-17 21:00:54.000000','slike/dogadjaji/troy.jpg','planiran','Klub Troy svako subote organizuje Tehno žurku. DJ Matinee kao jedan od najboljih srpskih DJ-eve će i ove subote biti na stejdžu.','Žurka u klubu Troy. Mesta su ograničena, rezervacija - obavezna',4,42),(69,'Kafanska sreda - Limun Žut','Limun Žut','2023-07-17 20:30:54.000000','slike/dogadjaji/limun-zut.jpg','planiran','Ove srede u Limun Žut dolazi Peđa Medenica. Već jedan od najpopularnijih termina, dodatno dobija na popularnosti zbog promocije i vrhunske muzike. Rezervacije su obavezne, a mesta ograničena.','Sreda uz Peđu Medenicu.  Ne propustite promociju - rakija košta koliko imate godina',1,42),(70,'Nedelja na Uzbuni','Splav Uzbuna','2023-07-30 22:30:54.000000','slike/dogadjaji/uzbuna-splav.jpg','planiran','OK Band i ove godine dolazi na Uzbunu. Ne propustite jednu od najboljih žurki i rezervišite svoje mesto.','OK Band na Uzbuni ove nedelje. Uz promo cene, očekuje vas najbolji repertoar.',1,42),(71,'Women in data science','Crown plaza','2023-07-10 18:00:54.000000','slike/dogadjaji/wids.jpg','planiran','Women in Data Science (WiDS) je konferencija koju na globalnom nivou organizuje Univerzitet u Stanfordu (USA), a ove godine se održava na čak 200+ lokacija širom sveta. Jedna od lokacija je i Beograd. Cilj konferencije jeste predstavljanje izvanrednih postignuća žena koje radi u oblasti nauke o podacima, a pozvani su svi koji žele da svojim prisustvom uveličaju ovaj događaj i da uživaju u DATA pričama, bez obzira na pol, starost i oblast kojom se bave.','Želiš da se oprobaš u Data Science-u, a nisi imala prilike? Ovo je idealno mesto.',1,43),(72,'GitOps meetup','Crown plaza','2023-07-24 21:00:54.000000','slike/dogadjaji/conf.jpg','planiran','Na ovom meetup-u ćemo pričati o temama:\r\nŠta je SaaS?\r\nKako GitOps pomaže u upravljanju SaaS rešenjima?\r\nEvolucija rešenja kroz primer sa projekta\r\nHands On experience: ApplicationSet i GitOps principi\r\nU ulozi predavača biće sjajan tandem - Slađana Tufegdžić, Java Tech Lead i Dušan Ostraćanin, Senior DevOps, koji su deo Levi9 oko dve godine.','Zanima vas GitOps? Najneri vas pozivaju meetup u Beogradu. Mesta su ograničena',1,43),(73,'Meetup: Building for Everyone','Mona plaza','2023-07-17 18:30:54.000000','slike/dogadjaji/conference.jpg','planiran','Novim meetupom pod nazivom \"Building for Everyone\" želimo da bolje razumemo način funkcionisanja osoba sa posebnim potrebama i podignemo svest o najboljim praksama za kreiranje pristupačnijih i inkluzivnijih tehnoloških proizvoda.\r\n\r\nNeuroblast, SignAvatar i Orion Innovation će kroz svoje iskustvo u kreiranju proizvoda namenjenih baš osobama sa posebnim potrebama približiti prisutnima na koji način tehnologija može pomoći, ali i na šta treba da obratimo pažnju kako bi proizvodi koje kreiramo bili što dostupniji svim segmentima društva.','Pristupačnost i inkluzija u tehnologiji su važna pitanja koja utiču na milione ljudi širom sveta.',1,43),(74,'Digital Future - Conference & Job Fair','Plaza, 1. sprat','2023-07-10 17:30:54.000000','slike/dogadjaji/digital.jpg','planiran','Teme o kojima će se pričati su: \r\n\r\nArtifical intelligence, \r\nBlockchain,\r\nMetaverse,\r\nDigitalni marketing & ecommerce.\r\nNeki od predavača su:\r\n\r\nPetar Vasić,\r\nIvan Bjelajac,\r\nIstok Pavlović i mnogi drugi.\r\nUpoznaj eksperte u ovim oblastima i nauči koji su to poslednji trendovi u digitalnoj i web3 industriji!','Digital future je tehnološka konferencija, ispraćena sajmom kompanija, koja okuplja preko 200 delega',5,43),(75,'Humanitarna licitacija knjiga','FTN','2023-07-17 10:00:54.000000','slike/dogadjaji/licitacija.jpg','planiran','Tradicionalna humanitarna licitacija na kojoj se može naći puno vrsta knjiga i udžbenika. Dođite i pomozite organizaciji Srbi za Srbe jer Vaše malo može nekome značiti mnogo.','Pridruzite se humanitarnoj licitaciji knjige i pomozite organizaciji Srbi za Srbe.',2,43);
